E_D("replace into `go_shoplist` values('230','78','6','10','苹果（Apple）iPad Air 2 9.7英寸平板电脑 16G WiFi版薄至6.1mm','color:#FF0000;','突破性的 Touch ID 技术，新 A8X 芯片，迄今为止速度最快、性能极强的一款 iPad！（颜色随机发）','佳能,单反,数码相机','我就是ipad air','3.00','1.00','3','3','0','0','50','100','shopimg/20151205/66217007303886.jpg','a:4:{i:0;s:35:\"shopimg/20151205/77228245303897.jpg\";i:1;s:35:\"shopimg/20151205/34369493303897.jpg\";i:2;s:35:\"shopimg/20151205/66534026303897.jpg\";i:3;s:35:\"shopimg/20151205/75756433303897.jpg\";}','<p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 10px 0px 0px; text-align: center; line-height: 50px; letter-spacing: 5px; font-size: 45px;\">	iPad Air 2</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 30px 0px 20px 55px; text-align: center; color: rgb(51, 51, 51); line-height: 40px; letter-spacing: 10px; font-size: 35px;\">	轻轻地，改变一切。</p><p>&nbsp;</p><p style=\"margin: 0px; text-align: center; padding-top: 50px;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154812638.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 30px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 45px; letter-spacing: 4px; font-size: 30px;\">	多才多能，让你不想放手；<br/>	又轻又薄，让你不觉在手。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 440px 50px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	对于 iPad，我们一直都有一个看似自相矛盾的目标：要创造一部功能极为强大，但又轻盈纤薄到你不觉在手的设备；一部让你能全力挥洒，但却毫不费力的设备。 iPad Air 2 不仅实现了这一切，甚至还超出了我们的预期。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 160px 0px 0px 350px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 1px; font-size: 35px;\">	显示屏，不仅更薄，<br/>	还更显出色。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 20px 0px 350px; color: rgb(51, 51, 51); line-height: 26px; letter-spacing: 1px; font-size: 15px;\">	为打造 iPad Air 2 令人惊叹的纤薄外形，我们从重新设计 Retina\n显示屏开始，将原本的三层合为一层。这样做的成果不仅是让它更薄，同时也让显示效果更好。由此色彩表现更鲜艳，对比度也更出色。而且我们还增添了抗反射涂\n层，让 iPad Air 2 的反光率再创新低。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 0px 0px 350px; color: rgb(51, 51, 51); line-height: 48px; letter-spacing: 2px; font-size: 13px;\"><span style=\"font-size: 38px;\">9.7</span> 英寸 <span style=\"padding-left: 20px; font-size: 35px;\">2048×1536</span></p><p>&nbsp;</p><p style=\"margin: 0px; padding: 0px 0px 0px 350px; color: rgb(51, 51, 51); line-height: 20px; letter-spacing: 2px; font-size: 15px;\">	显示屏 <span style=\"padding-left: 70px;\">分辨率</span></p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 0px 0px 350px; color: rgb(51, 51, 51); line-height: 48px; letter-spacing: 2px; font-size: 13px;\"><span style=\"font-size: 38px;\">310 </span> 万 <span style=\"padding-left: 20px; font-size: 35px;\">264</span></p><p>&nbsp;</p><p style=\"margin: 0px; padding: 0px 0px 0px 355px; color: rgb(51, 51, 51); line-height: 20px; letter-spacing: 2px; font-size: 15px;\">	像素 <span style=\"padding-left: 90px;\">PPI</span></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 50px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 50px; letter-spacing: 4px; font-size: 35px;\">	力量极强大，形态极简约。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 410px 60px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	iPad Air 2 不仅薄了许多，还强大更多。和上一代相比，我们设计的全新 A8X\n芯片在中央处理器和图形处理器性能上均有切实显著的提升。事实上，凭借 64 位台式电脑级架构，iPad Air 2\n所拥有的强大性能可与众多个人电脑相媲美。不仅如此，它的能效也非常出色，长达 10\n小时的电池使用时间，可满足你日常一天的工作、娱乐、浏览网络及购物所用。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 50px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 4px; font-size: 35px;\">	独一无二的指纹，<br/>	成就独到的安全保护。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 60px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	iPad Air 2 配备了我们突破性的 Touch ID\n技术，它凭借你的指纹，这一与生俱来的完美密码，将安全性提升到前所未有的级别。因此，只需轻轻一触，你即可解锁自己的 iPad Air 2。但\nTouch ID 所能做的远不止于此，它还可以让你在 iBooks 及 App Store 中安全地进行下载或购买。</p><p>&nbsp;</p><p style=\"margin: 0px; text-align: center; padding-top: 50px;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154914756.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 50px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 4px; font-size: 35px;\">	两部出色的相机，<br/>	藏身一部 iPad 之中。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 30px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	iPad Air 2 配备了我们迄今为止极为出色的全新 iSight 摄像头。它拥有先进的光学技术、优化的传感器和 Apple\n设计的强大图像信号处理器。它还加入一系列照片和视频的全新功能，如全景、延时摄影视频、慢动作视频，以及连拍快照和计时模式。前置 FaceTime\nHD\n高清摄像头也经过重新设计，拥有优化的传感器和更大尺寸像素，使其在弱光条件下的表现更出色。这一切，让你所有照片和视频，以及视频通话和自拍，看起来都\n漂亮极了。</p><p>&nbsp;</p><p style=\"margin: 0px; text-align: center; padding-top: 50px;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154920765.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 50px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 4px; font-size: 35px;\">	更快无线网络连接，<br/>	精彩无需等待。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 50px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	Pad Air 2 的无线网络连接速度非常快，达到前代产品的两倍以上。因此，下载大文件和传输流媒体视频都比以往更省时间。而且 WLAN + Cellular 机型还具备更快速、更先进的 4G LTE 技术，因此即使身处匆匆行程之中，你也能轻松连接高速网络。</p><p>&nbsp;</p><p style=\"margin: 0px; text-align: center; padding-top: 20px;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154927978.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 50px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 4px; font-size: 35px;\">	众多 App，为 iPad 量身打造，<br/>	也为成就你想做的一切。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 50px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	iPad Air 2 内置多款强大 app\n来让你处理日常事务，比如浏览网络，查收电子邮件，编辑影片和照片，撰写报告和阅读图书。不仅如此，App Store 中还有成千上万款 app，专为 iPad 宽大的多点触控 Retina 显示屏而精心设计，绝不仅仅是手机 app\n的简单放大。因此，无论你是爱好摄影，游戏，旅行，还是想管理自己的财务，总有一款 app 会让你做得更出色。</p><p>&nbsp;</p><p style=\"margin: 0px; text-align: center; padding-top: 50px;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154934369.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 50px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 4px; font-size: 35px;\">	iOS 8 和 iPad Air 2，<br/>	强强联手。</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 30px 0px; text-align: center; line-height: 26px; font-size: 14px;\">	iOS 8 是超前的移动操作系统，其先进功能让 iPad Air 2\n变得更不可或缺。连续互通功能可让你在这部设备上开始一个项目，然后在另一部设备上继续完成。家人共享功能让你与多达六人轻松共享图书和 app。而\niCloud Drive 可让你安全存储各种类型的文档，并从你的各种设备上访问。事实上，iOS 8 上的一切功能不仅是为了与 iPad Air 2 默契配合而设计，也是为了将强大的 A8X 芯片、超快的无线连接、以及绚丽 Retina 显示屏的优势发挥到淋漓尽致而打造。</p><p>&nbsp;</p><p style=\"margin: 0px; text-align: center; padding-top: 50px;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154942167.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 20px 0px 10px; line-height: 25px; font-size: 18px;\">	重要说明：</p><p>&nbsp;</p><p style=\"margin: 0px; padding: 0px 0px 10px 40px; line-height: 22px; font-size: 14px;\">	1元云购将在商品到货后第一时间按订单顺序发出，颜色随机发。</p><p>&nbsp;</p><p><br/></p>','shopcodes_1','0','1','1','1453369387','1','532','a:5:{s:3:\"uid\";s:3:\"532\";s:8:\"username\";s:6:\"银明\";s:5:\"email\";s:0:\"\";s:6:\"mobile\";s:0:\"\";s:3:\"img\";s:16:\"photo/member.jpg\";}','10000002','a:100:{i:0;a:8:{s:4:\"time\";s:14:\"1453370221.271\";s:8:\"username\";s:6:\"银明\";s:3:\"uid\";s:3:\"532\";s:6:\"shopid\";s:3:\"230\";s:8:\"shopname\";s:72:\"苹果（Apple）iPad Air 2 9.7英寸平板电脑 16G WiFi版薄至6.1mm\";s:9:\"shopqishu\";s:2:\"50\";s:8:\"gonumber\";s:1:\"3\";s:8:\"time_add\";s:9:\"175701271\";}i:1;a:8:{s:4:\"time\";s:14:\"1453370205.361\";s:8:\"username\";s:9:\"钱多多\";s:3:\"uid\";s:3:\"324\";s:6:\"shopid\";s:3:\"110\";s:8:\"shopname\";s:32:\"iPad Pro 12.9 英寸平板电脑\";s:9:\"shopqishu\";s:1:\"2\";s:8:\"gonumber\";s:1:\"5\";s:8:\"time_add\";s:9:\"175645361\";}i:2;a:8:{s:4:\"time\";s:14:\"1453370115.353\";s:8:\"username\";s:6:\"郑钱\";s:3:\"uid\";s:3:\"329\";